import Header from "../component/Header";
import Popular from "../component/Popular";
const Home = () => {
  return (
    <main>
      <Header></Header>
      <Popular></Popular>
      <div className="card">
        <h3 className="card__title card__title--center">NeFT features</h3>
        <div className="article-wrapper">
          <img
            className="article-logo"
            src={require("../images/time.png")}
            alt=""
          />
          <h4 className="">Manage your portfolio</h4>
          <p>
            To begin trading cryptocurrency, fund your cryptocurrency account.
            You can add funds using a variety of payment methods.
          </p>
        </div>
      </div>
    </main>
  );
};

export default Home;
